Story time: 

It’s #ASB2020 and this little party truck moment was the culmination of a talk that @jeffjonesracing and I had after a few drinks. We had a great day of drifting and we were lit for more partying. 

Now, this video right here is much more than just a little party truck. This night was the first time that @jeffjonesracing and I sat down and talked about what the SoCal drifting scene needed. We chatted about the positives, negatives, threw down a ton of ideas of “what would be cool” to see and more. We didn’t know it back then but this moment lit a small fire under our butts to ideate, research and create what is now a reality. 

Fast forward 2 years later (and after lots of cold calling tracks, brands and more…) Jeff and I decided  to call 2 other buddies and create our first event. In our mind it was critical that what we created was not just “a race”. Heck no.. it had to be festival lead by a full drift series and lifestyle activities. We didn’t know how challenging it would get but also how rewarding it would be.

The video above means so much as it started what you guys call now @hotpitautofest . The video above lead me to not only a great friendship but also to learn from a friend. The video above lead me to challenges in life.
-
Life has its way to lead you to people but it’s up to us  to cherish the moment and find opportunities in it. - glad to be doing business with a guy that I admired as a driver, but even happier to be doing life with friends. 
-
